This is a complete collection of all the &quot;I Quit&quot; matches from WWF / E!
An &quot;I Quit&quot; Match is A type of Professional Wrestling Match in Which the Only Way to Win is to make the opponent Say the Words &quot;I Quit&quot;. It is different from a submission match, in that merely tapping out, which is usually sufficient to signify submission, is not enough in this match; the forfeiting opponent must actually state &quot;I quit.&quot; Generally, whenever a wrestler knocks down his opponent with a move or inflicts a submission move, he will grab the microphone and ask the opponent to say &quot;I quit&quot; and the opponent (at least early in the match) will make some kind of retort . &quot;I Quit&quot; matches are commonly used to settle kayfabe grudges and embarrass rivals, since saying &quot;I Quit&quot; is usually a sign of admitted inferiority.


